css:
.editor-colors {
  background-color: #ffffff;
  color: #333333;
}
.editor {
  font-family: Consolas, "Liberation Mono", Courier, monospace;
}
.editor .invisible-character,
.editor .indent-guide {
  color: #dddddd;
}
.editor .gutter {
  background-color: #ffffff;
  border-right: 1px #eeeeee solid;
}
.editor .gutter .line-number {
  opacity: 1;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #93a1a1;
}
.editor .cursor {
  border-color: #333333;
}
.editor .selection .region {
  background-color: #dddddd;
  color: #93a1a1;
}
.editor .line-number.cursor-line-no-selection {
  background-color: #dddddd;
}
.bracket-matcher {
  background-color: #93a1a1;
  opacity: 0.7;
}
.comment {
  color: #999988 !important;
  font-style: italic;
}
.punctuation {
  color: #333333;
  font-weight: bold;
}
.punctuation.separator {
  font-weight: normal;
}
.entity {
  color: #990000;
  font-weight: bold;
}
.entity.class {
  color: #445588;
}
.entity.inherited-class {
  color: #008080;
  font-weight: normal;
}
.support.class {
  color: #008080;
  font-weight: normal;
}
.keyword {
  color: #333333;
  font-weight: bold;
}
.storage.type {
  color: #009926;
}
.constant {
  color: #990073;
}
.constant.numeric,
.constant.boolean {
  color: #333333;
  font-weight: bold;
}
.variable {
  color: #008080;
}
.variable.parameter {
  color: #333333;
}
.delimiter,
.brace {
  color: #333333;
}
.delimiter.period {
  color: #333333;
}
.invalid.deprecated {
  text-decoration: underline;
  color: #dd1144;
}
.invalid.illegal {
  color: #dd1144;
}
.string {
  color: #dd1144;
}
.string .constant.character.escape {
  color: #dd1144;
}
.string.regexp {
  color: #009926;
}
.string.regexp .source.ruby.embedded,
.string.regexp .string.regexp.arbitrary-repitition {
  color: #009926;
}
